// src/components/InfoCard.jsx

import React from 'react';

const InfoCard = ({ chakra }) => (
  <div className="info-card" style={{ borderColor: chakra.color }}>
    <h2 style={{ color: chakra.color }}>{chakra.name}</h2>
    <p><strong>Location:</strong> {chakra.location}</p>
    <p><strong>Color:</strong> {chakra.color}</p>
    <p><strong>Frequency:</strong> {chakra.frequency}</p>
    <p><strong>Element:</strong> {chakra.element}</p>
    <p><strong>Governs:</strong> {chakra.governs}</p>
  </div>
);

export default InfoCard;
